// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract BetPulse is Ownable, ReentrancyGuard {
    IERC20 public immutable pulseToken;

    struct Bet {
        uint256 amount;
        uint256 odds; // em percentual, ex: 150 = 1.5x
        bool resolved;
        bool won;
    }

    // Mapeia: eventoId => endereço do usuário => aposta
    mapping(uint256 => mapping(address => Bet)) public bets;

    // Resultado oficial do evento
    mapping(uint256 => bool) public eventOutcome;

    // Controle de saque: eventoId => usuário => sacou?
    mapping(uint256 => mapping(address => bool)) public hasWithdrawn;

    // Eventos
    event BetPlaced(address indexed user, uint256 indexed eventId, uint256 amount, uint256 odds);
    event EventResolved(uint256 indexed eventId, bool outcome);
    event WinningsWithdrawn(address indexed user, uint256 indexed eventId, uint256 payout);

    constructor(address _pulseToken, address initialOwner) Ownable(initialOwner) {
        require(_pulseToken != address(0), "Token invalido");
        pulseToken = IERC20(_pulseToken);
    }

    function placeBet(uint256 eventId, uint256 amount, uint256 odds) external nonReentrant {
        require(amount > 0, "Valor invalido");
        require(odds >= 100, "Odds minimas: 100%");
        require(bets[eventId][msg.sender].amount == 0, "Ja apostou");
        require(!eventOutcome[eventId], "Evento encerrado");

        // Transferência do token
        bool ok = pulseToken.transferFrom(msg.sender, address(this), amount);
        require(ok, "Falha na transferencia");

        bets[eventId][msg.sender] = Bet({
            amount: amount,
            odds: odds,
            resolved: false,
            won: false
        });

        emit BetPlaced(msg.sender, eventId, amount, odds);
    }

    function resolveEvent(uint256 eventId, bool outcome) external onlyOwner {
        require(!eventOutcome[eventId], "Evento ja resolvido");

        // Define o resultado
        eventOutcome[eventId] = outcome;

        emit EventResolved(eventId, outcome);
    }

    function markResult(address user, uint256 eventId, bool won) external onlyOwner {
        Bet storage bet = bets[eventId][user];
        require(bet.amount > 0, "Sem aposta");
        require(!bet.resolved, "Ja resolvida");

        bet.resolved = true;
        bet.won = won;
    }

    function withdrawWinnings(uint256 eventId) external nonReentrant {
        Bet storage bet = bets[eventId][msg.sender];
        require(bet.amount > 0, "Nenhuma aposta");
        require(bet.resolved, "Aposta nao resolvida");
        require(bet.won, "Aposta perdida");
        require(!hasWithdrawn[eventId][msg.sender], "Ja sacado");

        uint256 payout = (bet.amount * bet.odds) / 100;
        require(payout <= bet.amount * 1000, "Payout acima do limite"); // Segurança: max 1000x

        hasWithdrawn[eventId][msg.sender] = true;
        delete bets[eventId][msg.sender];

        bool ok = pulseToken.transfer(msg.sender, payout);
        require(ok, "Falha na transferencia");

        emit WinningsWithdrawn(msg.sender, eventId, payout);
    }
}

